import React, { useState, ChangeEvent } from 'react';

interface ClientInfo {
  name: string;
  dateOfBirth: string;
  identificationNumber: string;
  address: string;
  city: string;
  state: string;
  zipCode: string;
  telephone: string;
  otherInformation: string;
}

interface ConsentInfo {
  healthcareProviders: string;
  mentalHealthProviders: string;
  substanceUseProviders: string;
  dshsContractedProviders: string;
  housingPrograms: string;
  schoolDistricts: string;
  corrections: string;
  employmentSecurity: string;
  socialSecurity: string;
  other: string;
  reasonForDisclosure: {
    continuity: boolean;
    legal: boolean;
    personal: boolean;
    other: boolean;
    otherText: string;
  };
  records: {
    allRecords: boolean;
    attachedList: boolean;
    selectedRecords: {
      familyHistory: boolean;
      treatmentPlans: boolean;
      paymentRecords: boolean;
      assessments: boolean;
      education: boolean;
      mentalHealth: boolean;
      healthCare: boolean;
      other: boolean;
    };
  };
  permissions: {
    mentalHealth: boolean;
    hivAids: boolean;
    substanceUse: boolean;
  };
  expiration: {
    oneYear: boolean;
    specificDate: string;
  };
}

interface FormData {
  clientInfo: ClientInfo;
  consentInfo: ConsentInfo;
}

const DSHSConsentForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    clientInfo: {
      name: '',
      dateOfBirth: '',
      identificationNumber: '',
      address: '',
      city: '',
      state: 'Washington',
      zipCode: '',
      telephone: '',
      otherInformation: ''
    },
    consentInfo: {
      healthcareProviders: '',
      mentalHealthProviders: '',
      substanceUseProviders: '',
      dshsContractedProviders: 'Thrive International, 110 E 4th Avenue, Spokane, WA 99202',
      housingPrograms: '',
      schoolDistricts: '',
      corrections: '',
      employmentSecurity: '',
      socialSecurity: '',
      other: '',
      reasonForDisclosure: {
        continuity: false,
        legal: false,
        personal: false,
        other: false,
        otherText: ''
      },
      records: {
        allRecords: false,
        attachedList: false,
        selectedRecords: {
          familyHistory: false,
          treatmentPlans: false,
          paymentRecords: false,
          assessments: false,
          education: false,
          mentalHealth: false,
          healthCare: false,
          other: false
        }
      },
      permissions: {
        mentalHealth: false,
        hivAids: false,
        substanceUse: false
      },
      expiration: {
        oneYear: true,
        specificDate: ''
      }
    }
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value, type } = e.target;
    const checked = (e.target as HTMLInputElement).checked;

    const updateNestedValue = (obj: any, path: string[], value: any) => {
      const lastKey = path.pop()!;
      const lastObj = path.reduce((obj, key) => obj[key], obj);
      lastObj[lastKey] = value;
      return { ...obj };
    };

    if (name.includes('.')) {
      const path = name.split('.');
      setFormData(prev => ({
        ...prev,
        [path[0]]: updateNestedValue(prev[path[0] as keyof FormData], path.slice(1), type === 'checkbox' ? checked : value)
      }));
    } else {
      setFormData(prev => ({
        ...prev,
        [name]: type === 'checkbox' ? checked : value
      }));
    }
  };

  return (
    <div style={{ maxWidth: '1000px', margin: '0 auto', padding: '20px' }}>
      <div style={{ textAlign: 'center', marginBottom: '20px' }}>
        <img src="/path-to-dshs-logo.png" alt="DSHS Logo" style={{ height: '60px' }} />
        <h1 style={{ fontSize: '24px', fontWeight: 'bold', margin: '20px 0' }}>Consent</h1>
      </div>

      <form style={{ border: '1px solid #ccc', padding: '20px', borderRadius: '8px' }}>
        {/* Client Identification */}
        <div style={{ marginBottom: '20px' }}>
          <h2 style={{ borderBottom: '2px solid #333', paddingBottom: '5px', marginBottom: '15px' }}>
            Client Identification
          </h2>
          <div style={{ display: 'grid', gridTemplateColumns: '2fr 1fr 1fr', gap: '15px' }}>
            <input
              type="text"
              name="clientInfo.name"
              value={formData.clientInfo.name}
              onChange={handleChange}
              placeholder="NAME"
              style={{
                width: '100%',
                padding: '8px',
                border: '1px solid #ccc',
                borderRadius: '4px'
              }}
            />
            <input
              type="date"
              name="clientInfo.dateOfBirth"
              value={formData.clientInfo.dateOfBirth}
              onChange={handleChange}
              placeholder="DATE OF BIRTH"
              style={{
                width: '100%',
                padding: '8px',
                border: '1px solid #ccc',
                borderRadius: '4px'
              }}
            />
            <input
              type="text"
              name="clientInfo.identificationNumber"
              value={formData.clientInfo.identificationNumber}
              onChange={handleChange}
              placeholder="IDENTIFICATION NUMBER"
              style={{
                width: '100%',
                padding: '8px',
                border: '1px solid #ccc',
                borderRadius: '4px'
              }}
            />
          </div>

          <div style={{ display: 'grid', gridTemplateColumns: '2fr 1fr 1fr 1fr', gap: '15px', marginTop: '15px' }}>
            <input
              type="text"
              name="clientInfo.address"
              value={formData.clientInfo.address}
              onChange={handleChange}
              placeholder="ADDRESS"
              style={{
                width: '100%',
                padding: '8px',
                border: '1px solid #ccc',
                borderRadius: '4px'
              }}
            />
            <input
              type="text"
              name="clientInfo.city"
              value={formData.clientInfo.city}
              onChange={handleChange}
              placeholder="CITY"
              style={{
                width: '100%',
                padding: '8px',
                border: '1px solid #ccc',
                borderRadius: '4px'
              }}
            />
            <input
              type="text"
              name="clientInfo.state"
              value={formData.clientInfo.state}
              onChange={handleChange}
              placeholder="STATE"
              style={{
                width: '100%',
                padding: '8px',
                border: '1px solid #ccc',
                borderRadius: '4px'
              }}
            />
            <input
              type="text"
              name="clientInfo.zipCode"
              value={formData.clientInfo.zipCode}
              onChange={handleChange}
              placeholder="ZIP CODE"
              style={{
                width: '100%',
                padding: '8px',
                border: '1px solid #ccc',
                borderRadius: '4px'
              }}
            />
          </div>
        </div>

        {/* Disclosure Reason */}
        <div style={{ marginBottom: '20px' }}>
          <h2 style={{ borderBottom: '2px solid #333', paddingBottom: '5px', marginBottom: '15px' }}>
            Reason for Disclosure
          </h2>
          <div style={{ display: 'flex', gap: '20px' }}>
            {[
              ['continuity', 'Continuity of care'],
              ['legal', 'Legal'],
              ['personal', 'Personal'],
              ['other', 'Other']
            ].map(([key, label]) => (
              <label key={key} style={{ display: 'flex', alignItems: 'center' }}>
                <input
                  type="checkbox"
                  name={`consentInfo.reasonForDisclosure.${key}`}
                  checked={formData.consentInfo.reasonForDisclosure[key as keyof typeof formData.consentInfo.reasonForDisclosure] as boolean}
                  onChange={handleChange}
                  style={{ marginRight: '8px' }}
                />
                {label}
              </label>
            ))}
          </div>
        </div>

        {/* Records Selection */}
        <div style={{ marginBottom: '20px' }}>
          <h2 style={{ borderBottom: '2px solid #333', paddingBottom: '5px', marginBottom: '15px' }}>
            Records to be Shared
          </h2>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
            <label style={{ display: 'flex', alignItems: 'center' }}>
              <input
                type="checkbox"
                name="consentInfo.records.allRecords"
                checked={formData.consentInfo.records.allRecords}
                onChange={handleChange}
                style={{ marginRight: '8px' }}
              />
              All my client records
            </label>
            {Object.entries(formData.consentInfo.records.selectedRecords).map(([key, value]) => (
              <label key={key} style={{ display: 'flex', alignItems: 'center', marginLeft: '20px' }}>
                <input
                  type="checkbox"
                  name={`consentInfo.records.selectedRecords.${key}`}
                  checked={value}
                  onChange={handleChange}
                  disabled={formData.consentInfo.records.allRecords}
                  style={{ marginRight: '8px' }}
                />
                {key.replace(/([A-Z])/g, ' $1').charAt(0).toUpperCase() + key.slice(1)}
              </label>
            ))}
          </div>
        </div>

        {/* Special Permissions */}
        <div style={{ marginBottom: '20px', padding: '15px', backgroundColor: '#f8f8f8', borderRadius: '4px' }}>
          <h3 style={{ marginBottom: '10px' }}>Special Permissions</h3>
          <p style={{ marginBottom: '10px', fontSize: '14px' }}>
            If your client records include any of the following information, you must also complete this section to include these records.
          </p>
          <div style={{ display: 'flex', gap: '20px' }}>
            {[
              ['mentalHealth', 'Mental health'],
              ['hivAids', 'HIV/AIDS and STD test results, diagnosis, or treatment'],
              ['substanceUse', 'Substance Use Disorder']
            ].map(([key, label]) => (
              <label key={key} style={{ display: 'flex', alignItems: 'center' }}>
                <input
                  type="checkbox"
                  name={`consentInfo.permissions.${key}`}
                  checked={formData.consentInfo.permissions[key as keyof typeof formData.consentInfo.permissions]}
                  onChange={handleChange}
                  style={{ marginRight: '8px' }}
                />
                {label}
              </label>
            ))}
          </div>
        </div>

        <button
          type="submit"
          style={{
            backgroundColor: '#0066cc',
            color: 'white',
            padding: '10px 20px',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer',
            float: 'right'
          }}
        >
          Submit Consent Form
        </button>
      </form>
    </div>
  );
};

export default DSHSConsentForm;
